import React, { useEffect } from 'react'
import axios from 'axios'
import {useState} from 'react';
const Allpost = ()=>{
    const [allpost,setAllpost]=useState([]);
     useEffect(()=>{
        axios.get('http://localhost:5000/allposts')
         .then(result=>{
             setAllpost(result.data);
         })
     },[])

    return(
        <div>
           {
               allpost.map(post=>(
                   <div>
                       <p>{post.name}</p>
                       <p>{post.title}</p>
                       <p>{post.story}</p>
                   </div>
               ))
           }
        </div>
    );
}

export default Allpost;
